INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('43337689-6bb1-423d-9511-71b55844eede', 'Cauliflower and Chickpea Curry ', 324, 11, 317, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'This beautifully simple light curry is closely based on a wonderful recipe from chef Angela Hartnett Its always preferable to use some carefully selected ground and whole spices in a recipe like this but if youre in a hurry use a readymade curry powder instead of the dry spices', '2023-06-12 17:15:55.336', '2023-06-13 00:15:55.168');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('fd3667ed-1aef-46d6-b3db-ad812e379f6c', 'Dried Fruit Compote with Port, Cinnamon, and Ginger ', 136, 0, 20, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'Carol Gilbert of Saratoga California writes Ive been working fulltime since my daughter was in high school but it took about ten years to get over the notion that I should be cooking everything  the way my mother did  and climb the corporate ladder Theres simply not enough time I finally realized I didnt have to make everything from scratch now I give myself permission to buy a dessert or a salad dressing if I need to', '2023-06-12 17:15:55.34', '2023-06-13 00:15:55.168');
