INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('561f8ae0-dee2-406a-acdd-e48cbef5b67d', 'Asparagus Salad with Sweet Balsamic Vinegar ', 221, 17, 52, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'Boiling the vinegar concentrates and sweetens it so the dressing doesnt require as much oil to balance the acid', '2023-06-12 17:15:55.363', '2023-06-13 00:15:55.168');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('adbd4dc8-d439-4b01-bf78-80945b18c5e5', 'Brown Rice Pilaf with Saffron and Ginger ', 0, 0, 0, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'Healers have touted saffrons medicinal properties since the days of Hippocrates and Cleopatra claimed that it was an aphrodisiac Its scarcity it takes some four thousand crocus blossoms to create an ounce of saffron and the belief that it could be used to treat everything from wounds to the plague even caused the Austrians to go to war over the spice during the Dark Ages This is at least one feudal folk myth that modern science has corroborated Studies have shown that saffron has outstanding antibacterial and antiviral properties and also aids digestion People sometimes balk at saffrons cost but it isnt unreasonable when you consider its potency this recipe calls for only 18 teaspoon and as youll see a little goes a long way This pilaf is a delightful and gorgeous dish The rice is sauted before cooking to avoid that sticky gummy consistency and ginger parsley and lemon zest add zing', '2023-06-12 17:15:55.368', '2023-06-13 00:15:55.168');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('433f3b55-3706-4929-98da-37d8b65006ef', 'Lemon Mint Braised Artichokes ', 209, 9, 246, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'As a harbinger of spring artichokes have a special place on the Passover table and in our hearts One of Robertss favorite ways to enjoy them is this elegant Roman preparation Rome is home to the oldest Jewish community in the Western worldthe first Jews arrived in 161 bce as ambassadors from Judah Maccabee in Jerusalem The trimmed artichokes are braised in a lemony broth zinging with garlic and mint which is later reduced to a satiny sauce', '2023-06-12 17:15:55.371', '2023-06-13 00:15:55.168');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('11cfc37a-7342-4df7-8203-d6e34a820dbc', 'Peaches in Ginger Syrup ', 102, 0, 2, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'nan', '2023-06-12 17:15:55.375', '2023-06-13 00:15:55.168');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('09f71c00-8272-4df6-9d02-102e33f0a4ff', 'Quick Kimchi ', 150, 5, 937, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'No Korean meal is complete without kimchi a piquant condiment of fermented vegetables most popularly cabbage seasoned with ginger garlic chile and all manner of fresh or preserved seafood Fermenting the ingredients over several days gives the dish its distinctive tang but this easy version which takes advantage of the funky depth of Asian fish sauce offers relatively instant gratification', '2023-06-12 17:15:55.379', '2023-06-13 00:15:55.168');
