INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('04101455-a914-472a-89ab-a4720b687029', 'Sofrito Grilled Bread ', 0, 0, 0, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'Sofrito is a sauted vegetable mixture used as a seasoning in much of Latin America and the Caribbean It typically contains garlic onion bell pepper coriander and sometimes tomatoes or ham although the recipe varies among countries In our version weve omitted the oil normally used to cook the ingredients and instead simply pured the vegetables', '2023-06-12 17:15:55.387', '2023-06-13 00:15:55.168');
