INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('fbdff1dd-9180-4947-83eb-2963bca5c7b6', 'Cranberry Kumquat Sauce ', 186, 1, 8, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'Kumquats and cranberries turn out to be a perfect match since their flavors are similar in intensity The former contributes a pleasant citrusy bitterness to the latters signature tartness', '2023-06-12 17:15:55.48', '2023-06-13 00:15:55.168');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('ca9b0476-a737-4084-a6a7-de98ec7a621b', 'White Bean and Artichoke Dip ', 0, 0, 0, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'If you spend evenings camped out on your sofa staring at the boob tube take note People who spend four hours or more in front of the TV are twice as likely to be overweight as those who watch less than an hour a day a new study from Australia reports Study participants bodymass index which measures how much of your weight is fat increased for every hour of TV time If you watch two hours a day youre 57 percent more likely to be overweight than those who keep tube time to an hour or less if you watch three or more hours youre 91 percent more likely to be overweight Whats worse past studies show that this pastime triggers the munchies for highfat snacks though researchers arent sure why If you must gaze at the box channel your snack urges toward something healthful like this creamy lowfat dip', '2023-06-12 17:15:55.391', '2023-06-13 00:15:55.168');
