INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('7c149bf5-dad7-4ee2-a26e-e7958988e49e', 'Roasted Pineapple-Habanero Chile Salsa ', 0, 0, 0, 0, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'All the vibrant sundrenched brilliance of the tropics is captured in this salsa that evolves in your mouthfirst sweet then hot Luscious ripe pineapple is a perfect partner to the fiery fragrant habanero chile Not only is the habanero the hottest chile readily available fresh when cut open it releases an intense perfume of ripe tropical fruitsmango pineapple citrus As a finishing touch a squeeze of fresh lime adds a pop of flavor and brightens the sometimes cloying sweetness of a really ripe pineapple This salsa pairs well with dishes that are tropical in origin or spirit that have bright fresh flavors or that have been simply marinated or grilled whether fish or meat Its delicious with almost all fish and seafood tacos and grilled chicken dishes If you cannot find fresh habaneros substitute one tablespoon of a fruity hot or extrahot habanero sauce with a mango base Melindas makes a good one for the habanero chile', '2023-06-12 17:15:55.403', '2023-06-13 00:15:55.168');
