INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('27dba1a6-05a3-46de-b4e1-dd46313d0a0c', 'Roasted Root Vegetables ', 198, 11, 165, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/20220118%2520Jujubes%2520LEDE.jpg', 'As a confirmed New Englander I was surprised to find a terrific seafood restaurant in Phoenix Steamers Genuine says Barbara J Johnson of Worcester Massachusetts The baked halibut was perfectly complemented by roasted vegetables and potatoes au gratin I know how to make the fish but I wouldnt know where to start with the other two dishes', '2023-06-12 17:15:55.521', '2023-06-13 00:15:55.168');
