INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('6da1bdf5-4cdc-453e-9e03-6306f0773580', 'Cauliflower and Chickpea Curry ', 324, 11, 317, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'This beautifully simple light curry is closely based on a wonderful recipe from chef Angela Hartnett Its always preferable to use some carefully selected ground and whole spices in a recipe like this but if youre in a hurry use a readymade curry powder instead of the dry spices', '2023-06-12 17:23:35.452', '2023-06-13 00:23:35.265');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('e2e4d530-01a4-4f79-adc6-163b849002a2', 'Dried Fruit Compote with Port, Cinnamon, and Ginger ', 136, 0, 20, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Carol Gilbert of Saratoga California writes Ive been working fulltime since my daughter was in high school but it took about ten years to get over the notion that I should be cooking everything  the way my mother did  and climb the corporate ladder Theres simply not enough time I finally realized I didnt have to make everything from scratch now I give myself permission to buy a dessert or a salad dressing if I need to', '2023-06-12 17:23:35.456', '2023-06-13 00:23:35.265');
