INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('858f28f9-a2e5-4a96-900a-d64067165f9a', 'Brown Rice Pilaf with Saffron and Ginger ', 0, 0, 0, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Healers have touted saffrons medicinal properties since the days of Hippocrates and Cleopatra claimed that it was an aphrodisiac Its scarcity it takes some four thousand crocus blossoms to create an ounce of saffron and the belief that it could be used to treat everything from wounds to the plague even caused the Austrians to go to war over the spice during the Dark Ages This is at least one feudal folk myth that modern science has corroborated Studies have shown that saffron has outstanding antibacterial and antiviral properties and also aids digestion People sometimes balk at saffrons cost but it isnt unreasonable when you consider its potency this recipe calls for only 18 teaspoon and as youll see a little goes a long way This pilaf is a delightful and gorgeous dish The rice is sauted before cooking to avoid that sticky gummy consistency and ginger parsley and lemon zest add zing', '2023-06-12 17:23:35.468', '2023-06-13 00:23:35.265');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('9bad1889-f646-47db-82bd-721ade07f58c', 'Lemon Mint Braised Artichokes ', 209, 9, 246, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'As a harbinger of spring artichokes have a special place on the Passover table and in our hearts One of Robertss favorite ways to enjoy them is this elegant Roman preparation Rome is home to the oldest Jewish community in the Western worldthe first Jews arrived in 161 bce as ambassadors from Judah Maccabee in Jerusalem The trimmed artichokes are braised in a lemony broth zinging with garlic and mint which is later reduced to a satiny sauce', '2023-06-12 17:23:35.472', '2023-06-13 00:23:35.265');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('2e0f557a-8356-4f25-b71d-daa22b7f05e3', 'Peaches in Ginger Syrup ', 102, 0, 2, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'nan', '2023-06-12 17:23:35.476', '2023-06-13 00:23:35.265');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('74b7f51d-3952-4018-9bae-d2d0722774df', 'Quick Kimchi ', 150, 5, 937, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'No Korean meal is complete without kimchi a piquant condiment of fermented vegetables most popularly cabbage seasoned with ginger garlic chile and all manner of fresh or preserved seafood Fermenting the ingredients over several days gives the dish its distinctive tang but this easy version which takes advantage of the funky depth of Asian fish sauce offers relatively instant gratification', '2023-06-12 17:23:35.481', '2023-06-13 00:23:35.265');
