INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('86a92599-dc40-4061-9f08-efd5b1525940', 'Sofrito Grilled Bread ', 0, 0, 0, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Sofrito is a sauted vegetable mixture used as a seasoning in much of Latin America and the Caribbean It typically contains garlic onion bell pepper coriander and sometimes tomatoes or ham although the recipe varies among countries In our version weve omitted the oil normally used to cook the ingredients and instead simply pured the vegetables', '2023-06-12 17:23:35.489', '2023-06-13 00:23:35.265');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('1966a582-f5b0-4ada-9b23-7ffe17dd45c2', 'White Bean and Artichoke Dip ', 0, 0, 0, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'If you spend evenings camped out on your sofa staring at the boob tube take note People who spend four hours or more in front of the TV are twice as likely to be overweight as those who watch less than an hour a day a new study from Australia reports Study participants bodymass index which measures how much of your weight is fat increased for every hour of TV time If you watch two hours a day youre 57 percent more likely to be overweight than those who keep tube time to an hour or less if you watch three or more hours youre 91 percent more likely to be overweight Whats worse past studies show that this pastime triggers the munchies for highfat snacks though researchers arent sure why If you must gaze at the box channel your snack urges toward something healthful like this creamy lowfat dip', '2023-06-12 17:23:35.493', '2023-06-13 00:23:35.265');
