INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('b3606c6f-2a96-4320-b432-ccbc32f62a37', 'Roasted Pineapple-Habanero Chile Salsa ', 0, 0, 0, 0, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'All the vibrant sundrenched brilliance of the tropics is captured in this salsa that evolves in your mouthfirst sweet then hot Luscious ripe pineapple is a perfect partner to the fiery fragrant habanero chile Not only is the habanero the hottest chile readily available fresh when cut open it releases an intense perfume of ripe tropical fruitsmango pineapple citrus As a finishing touch a squeeze of fresh lime adds a pop of flavor and brightens the sometimes cloying sweetness of a really ripe pineapple This salsa pairs well with dishes that are tropical in origin or spirit that have bright fresh flavors or that have been simply marinated or grilled whether fish or meat Its delicious with almost all fish and seafood tacos and grilled chicken dishes If you cannot find fresh habaneros substitute one tablespoon of a fruity hot or extrahot habanero sauce with a mango base Melindas makes a good one for the habanero chile', '2023-06-12 17:23:35.506', '2023-06-13 00:23:35.265');
