INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('e6897af8-745d-41ab-bee1-e9ee72775a4d', 'Spinach Salad with Bosc Pears, Cranberries, Red Onion, and Toasted Hazelnuts ', 241, 21, 278, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'This spinach salad speaks to all the wonderful autumnal flavors of the Pacific Northwest The new crop of bronzed Bosc pears is piled high at the farmers market the hazelnuts have been harvested shelled and bagged for sale and the cranberries arrive from the Long Beach Washington coastal bogs I buy sweetened dried cranberries from a local producer but they are readily available at the grocery store Ocean Spray is a goodquality packager found alongside raisins and other dried fruits This salad is a snap to assemble if you buy the packaged prewashed and trimmed baby spinach', '2023-06-12 17:23:35.628', '2023-06-13 00:23:35.265');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('25f345e6-c916-489a-b654-eb75a05819f8', 'Roasted Root Vegetables ', 198, 11, 165, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'As a confirmed New Englander I was surprised to find a terrific seafood restaurant in Phoenix Steamers Genuine says Barbara J Johnson of Worcester Massachusetts The baked halibut was perfectly complemented by roasted vegetables and potatoes au gratin I know how to make the fish but I wouldnt know where to start with the other two dishes', '2023-06-12 17:23:35.632', '2023-06-13 00:23:35.265');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('f81f4876-fa98-470f-85f7-bb18654033b9', 'Lentil Soup, Date Balls, Celery Salad ', 277, 6, 1274, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'This is my version of harira the national soup of Morocco which shows up in unending variations from city to city street stall to street stall and family to family It can be vegan vegetarian or made with meatusually lamb Some cooks add chickpeas chicken gizzards or brokenup bits of angel hair pasta But the result is always unmistakably harira and thats what makes it so comforting and satisfying', '2023-06-12 17:23:35.636', '2023-06-13 00:23:35.265');
