INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('8b1c5493-fb98-4f9e-b357-ca507d4f7d6a', 'Herb Salad Spring Rolls with Spicy Peanut Sauce ', 224, 3, 377, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Although several varieties of basil are used in Southeast Asia the most commoncalled rau que in Vietnam and bai gaprow in Thailandis generally referred to as Thai basil in Asian markets on this side of the Pacific The leaves are slightly darker and narrower than the more familiar Italian basil and have purple stems and flowers Rau que has a distinctively pungent anise flavor but Italian basil is a perfectly acceptable substitute', '2023-06-12 17:23:35.672', '2023-06-13 00:23:35.265');
