INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('4c013043-9a77-4def-a7a2-4bfb861eac76', 'English Pea Hummus ', 324, 27, 46, 0, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Though the healthful and now mainstream Middle Eastern dip we know as hummus typically includes chickpeas and sesame tahini this adaptation contains neither Rather its similarly smooth ure comes from the natural starch and protein of the English pea In the summer I make a variation of this using blanched field peas of any variety and I substitute thyme for the spring herbs and fresh garlic in place of the early green garlic of spring', '2023-06-12 17:23:36.83', '2023-06-13 00:23:35.267');
