INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('0b75fa7a-252f-498f-bf21-e58f7ce0beb8', 'Easy Vegetable Stock ', 0, 0, 0, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'It was a challenge for me to write a recipe for vegetable stock because in truth mine is different every time I am inspired to make it whenever I am prepping lots of veggies and I realize that what I have left overthe tops of four leeks three parsnip stubs carrot peels and tips and a pile of parsley stemsis almost everything I need to make a great stock When faced with the decision to capture these flavors so they can become the foundation for future delicious soups stews or beans versus adding them to my compost pile I try to choose the former Once you experience how much better your recipes turn out with homemade stock not to mention how much money you save and how many cartons you keep out of the trash youll get more motivated I usually keep a bag in the fridge where I save my veggie scraps and when it gets big enough I set my pot on the stove The recipe below is simple and easy You can also add corncobs potato skins mushroom bottoms and even tomatoes If you have a huge stockpot as I do you can easily double or triple this recipe I keep as much stock in the refrigerator as I plan to use within 5 days and freeze the rest Myra', '2023-06-12 17:23:37.484', '2023-06-13 00:23:35.268');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('57c2ce00-12f6-4877-8dc2-67227b057148', 'Perfect Steamed Rice ', 207, 0, 7, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'If you dont have a rice cooker this is the way to prepare absolutely perfect rice The liquid cooks down before you cover the pot so you have more control over how much liquid evaporates this makes all the difference between mushy and fluffy rice', '2023-06-12 17:23:37.488', '2023-06-13 00:23:35.268');
