INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('18657e38-b98e-4c8e-8bbf-1da56113ef54', 'Tofu Scramble with Yukon Gold and Sweet Potato Home Fries ', 425, 24, 185, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'We like to whip up this delicious tofu scramble with home fries made from Yukon Gold and sweet potatoes on lazy weekend mornings Begin to cook the scramble just as the home fries are nearly browned to perfection so you can serve this hearty and soulsatisfying breakfast all at once It tastes and looks great when accompanied by salsa or chopped tomatoes and a handful of gardenfresh herbs', '2023-06-12 17:23:37.981', '2023-06-13 00:23:35.27');
