INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('a6493d0e-0a5d-49f9-a0bb-6fb7584bf8af', 'Tofu Triangles in Creamy Nut Buttter Sauce with Scallions ', 0, 0, 0, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Here triangles of tofu are panfried simmered briefly in half the nut butter sauce and garnished with slivered scallion and sesame seeds The rest of the sauce can be spooned over brown rice noodles or whatever you choose as an accompaniment If possible present the tofu in the pan that its cooked in', '2023-06-12 17:23:37.996', '2023-06-13 00:23:35.27');
