INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('3a9b3944-f2fe-4ed6-b12b-10af9f7d1743', 'Seitan and Polenta Skillet with Fresh Greens ', 0, 0, 0, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Caravan of Dreams is one of the restaurants where my family likes to eat when were in New York City Its a funky comfortable place in the East Village with food thats hearty and innovative and all vegan Once my younger son ordered the Green Garden Platter described as seasonal mixed greens sauted with grilled marinated seitan garlic and olive oil topped with grilled carrot polenta in mushroom gravy I was intrigued by the combination of seitan and polenta so when I got home I made my own version which bears little resemblance to the restaurants Theres something enticing about seitanpolenta synergy and with the addition of greens the result is a greatlooking hearty dish', '2023-06-12 17:23:38.713', '2023-06-13 00:23:35.271');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('bfaa8bfe-4029-4c9a-b2bb-1290ea19dcf5', 'Butternut Squash, Kale, and Crunchy Pepitas Taco ', 124, 9, 695, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Drummed up by our intrepid recipe tester Lauren Godfrey this nontraditional taco sweet with squash earthy and nutty with kale and crunchy with fried pumpkin seeds pepitas isshhhhhvegan Dont tell anyone but because it is so tasty no one will care The cashew crema can be replaced by storebought crema or our Cuminlime crema but after polling both vegetarian and carnivorous friends everyone preferred the nutty and rich nondairy cashew version which must be made with raw cashews to work To prepare the butternut squash use a sharp peeler to remove the tough skin before slicing it in half and scooping out the seeds and fibers Lazy cooks tip Some markets sell butternut squash already peeled and seeded and ready to go', '2023-06-12 17:23:38.717', '2023-06-13 00:23:35.271');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('5ae4ff4e-2104-4b08-b66f-9a35e95ca3ca', 'Almond Aioli ', 93, 10, 119, 0, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Blanched almonds go into a blender with water and oil and come out as a luscious aioli Because the nuts arent toasted the sauce doesnt actually taste very nutty Its more decadent than yogurt more subtle than mayo', '2023-06-12 17:23:38.72', '2023-06-13 00:23:35.271');
