INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('be973fc0-0d12-43e4-8831-13203a459bdd', 'Lime, Ginger, and Lemongrass Sorbet ', 291, 0, 5, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'At Selamat Pagi our Balinese restaurant lime ginger and lemongrass are mainstay ingredients appearing in many dishes We were thinking about making a sorbet that reflected some of these ingredients and wondered what would happen if we threw all of them together Our initial taste transported us back to the lush green hills of Bali after which we were all too disappointed to find ourselves standing in our test kitchen Along with lemon sorbet this might be our goto refreshment when we desperately need to cool off', '2023-06-12 17:23:38.746', '2023-06-13 00:23:35.271');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('41417bcb-ec43-45d3-af5c-ddcb7ed282ea', 'Grilled Pineapple with Brown Sugar, Coconut, and Rum ', 367, 4, 40, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'If your grill is already fired up why not give it a quick brushing and throw dessert on there too A balanced tropical marinade brings depth to caramelized pineapple', '2023-06-12 17:23:38.749', '2023-06-13 00:23:35.271');
