INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('4ef5953d-8dcf-449b-beaa-e80518c2120a', 'Mom''s Sweet-and-Sour Red Cabbage ', 0, 0, 0, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'My mother grew up in Bad Nauheim Germany where she helped her parents with their inn and restaurant called Die Krone The Crown When I was growing up she cooked several traditional German dishes but one of the most memorable for me was her recipe for sweetandsour red cabbage Though I was a pretty picky eater I adored the cabbage and loved how it colored the mashed potatoes my mother would always serve with it Mom never wrote the recipe down for me but I reached out to German relatives and recreated it I hope you enjoy it as much as I enjoyed taking the trip down memory lane Grating the cabbage takes a while so make sure to have some good tunes on', '2023-06-12 17:23:38.758', '2023-06-13 00:23:35.271');
