INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('27cdba66-b54f-4af8-b7be-77949337da1b', 'Pot-Roasted Artichokes With White Wine and Capers ', 357, 14, 1145, 0, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'One of the reasons I go giddy about springtime is artichokes particularly the small ones with tips closed tightly like a flower at night Some home cooks are reluctant to fill their totes with artichokes as theyll need to be turnedthe barbed leaves plucked off and the other inedible bits trimmed away I quite like the process Its meditative and satisfying once you get the hang of it In this dish the fleshy artichokes get browned and crispy tops and look like strange beautiful roses The acidity in the white wine cuts through the rich dense veg and along with the salty pops from the capers highlights the artichokes unique herbaceousness', '2023-06-12 17:23:39.01', '2023-06-13 00:23:35.271');
