INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('76e198b5-564d-46bc-bf20-cc8ee481d809', 'Stir-Fried Cabbage ', 105, 7, 30, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'My wife Jean and I run a coffee farm on the Big Island of Hawaii writes George Fike of Keauhou Mauka Hawaii I really love to cook so we entertain a lot and I enjoy planning the dinners as much as I do making them I tell people the best restaurant in town is our house Since I do most of the cooking recipes must either be relatively fast or look after themselves', '2023-06-12 17:23:39.416', '2023-06-13 00:23:35.272');
