INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('b1ed9942-0c58-4e83-8bf6-deb7994fdde4', 'Fruit Salad with Herb, Citrus, Mint-Maple, or Basic Syrup ', 245, 2, 17, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'When I was growing up my mom would cut up fresh fruit and arrange it on a plate with a shot glass full of toothpicks She would also toss fresh fruit with some orange or lime juice and sugar Taking inspiration from her I came up with my own version lime lemon a little maple syrup and an herb syrup with rosemary or mintCut your fruit into chunks rather than into small pieces I find that small pieces of fruit get mealy and mushy Make the salad the morning youre going to serve it but if youre determined to make it the night before cut up the fruit store it in separate containers and then toss it together in the morning Use whatever fruit youd like bananas apples berriesthe possibilities are endless but unless youre using the ripest sweetest seasonal fruit add a little sugar', '2023-06-12 17:23:39.424', '2023-06-13 00:23:35.272');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('1033f61d-2a08-437d-8436-aae8f5958f84', 'Spiced Plum Chutney ', 0, 0, 0, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Chef Floyd Cardoz of Tabla in New York City is known for blending Indian spices with local ingredients Here plums are cooked with star anise clove cinnamon and ginger for a chutney thats perfect with bread and cheese', '2023-06-12 17:23:39.428', '2023-06-13 00:23:35.272');
