INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('becdb04c-8874-415e-927a-4ec45bc354a3', 'Roasted Herb Potato Medley ', 322, 11, 21, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Lane Crowther Bon Apptit contributing editor says When I was young the potatoes on the holiday table were always mashed Even today my mother who is still in charge of our Thanksgiving dinners will rarely stray from tradition Either there has to be a tradeoff to get her to try something new oras in the case of this recipeinnovation simply comes as an addition to the menu not a replacement Well with so many different kinds of potatoes available nowadays I like to mix varieties for their contrasting flavors ures and colors This combination of red potatoes and Yukon Gold is an easytomake and greattasting accompaniment to any meal', '2023-06-12 17:23:40.387', '2023-06-13 00:23:35.273');
