INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('555186aa-b324-4dbc-a6ec-fb7ade2dbeb1', 'Brain-Boosting Broth ', 4, 0, 92, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'This broth the backbone of many of our soup recipes and an ingredient in many others was developed with brain health in mind It includes onions fennel parsley oregano and rosemary all of which contain antioxidants as well as parsnips which are a good source of folic acid The recipe uses water as liquid but you can start with chicken stock or fish stock to make an especially flavorful broth that would be great for sipping on its own', '2023-06-12 17:23:40.428', '2023-06-13 00:23:35.273');
