INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('77cc43ba-73b5-4bd0-9d47-01447906c102', 'Cranberry, Fig, and Pinot Noir Chutney ', 253, 0, 3, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Cranberries are transformed with sweet subtly earthy dried figs and velvety slightly spicy Pinot Noir into a chunky jamlike chutney Orange zest infuses the mix with its bright citrus flavor and essential oils Ginger works well in both savory and sweet preparations and its touch of heat bridges the wine and fruit here You can serve this chutney instead of the standard cranberry sauce at Thanksgiving but it is also wonderful with pork and venison dishes spread on a sandwich or as an accompaniment to a cheese plate', '2023-06-12 17:23:40.92', '2023-06-13 00:23:35.274');
