INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('a8f304ee-8322-44d8-b353-405bb432a5f0', 'Cold-Brew Coffee ', 33, 0, 19, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'If youre using a commercial coldbrew maker like a Toddy follow the manufacturers instructions for mixing and filtering Feel free to play around with how you dilute thisyou might prefer a stronger or weaker coffee than the one suggested here And coffeeheads the world over agree coldbrew is only as good as the beans its made with', '2023-06-12 17:23:40.929', '2023-06-13 00:23:35.274');
