INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('15351c20-c19c-4236-9548-a9c4391a1563', 'Microgreens with Curry Vinaigrette ', 174, 19, 197, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Be sure to sample forest greens if you find them on a menu in Copenhagenthis term is not just a flight of fancy The greens on offer there are pristine wild lettuces herbs and grasses growing in the mountains and on the forest floor Since most of us dont have the opportunity to forage forest greens we made this salad with a tangle of microgreens which work nicely The vinaigrette nods to the Scandinavian love for curry but it truly plays up the flavors of the pork and potatoes as well so feel free to drizzle it all over the plate', '2023-06-12 17:23:41.065', '2023-06-13 00:23:35.274');
