INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('5b458f7b-5429-4ff4-820a-96da2ab8aa0b', 'Winter Vegetable Roast with Maple-Mustard Vinaigrette ', 376, 21, 1049, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Why do I love roast winter vegetables For starters because they are fresh local and seasonal Unlike summer produce they keep for a long time without losing most of their flavor They feel like winter food hearty substantial ribsticking Francis Mallmann quickroasts them at very high heat in a wood oven until they almost burn A home oven doesnt put out that kind of thousanddegree heat but when something as simple as slices of Delicata squash are coated with a little bit of olive oil sprinkled with kosher or coarse sea salt and then roasted they come out of the oven chewy nutty sweet and savory Part caramelization part umami and part Maillard', '2023-06-12 17:23:41.149', '2023-06-13 00:23:35.274');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('53575911-5fe1-43b6-bcb5-ea1f3cf30ef6', 'Eggplant, Potato and Pepper Casserole ', 864, 75, 130, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Majorcans love to talk about the quality of their vegetables and this dish of sautd eggplant potatoes and bell peppers in fresh tomato sauce called tumbet is one of their favorite creations We suggest serving it with grilled fish or lamb chops as Majorcans do', '2023-06-12 17:23:41.153', '2023-06-13 00:23:35.274');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('42eab48b-e6b4-4cc7-a21e-e6da23426d6b', 'French Fries ', 480, 34, 11, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'The trick to french fries is doublefrying First flashfry the potatoes to eliminate moisture then fry them again to ensure crispness Eating them with mayonnaise will take you to Europe', '2023-06-12 17:23:41.161', '2023-06-13 00:23:35.274');
