INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('029ad091-11a5-4878-96b7-12ea5f624eb3', 'Sauteed Baby Artichokes with Oven-Dried Tomatoes and Green-Olive Dressing ', 330, 21, 348, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Unlike their big brothers baby artichokes are almost completely edible and require minimal preparation For this first course sauting the artichokes instead of steaming adds good flavor Some people dont like to have artichokes with wine because they can make the wine taste either metallic or strangely sweet In Italy though artichokes and wine are usually served together A crisp steely Pinot Grigio does the trick', '2023-06-12 17:23:41.252', '2023-06-13 00:23:35.274');
