INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('9fda8488-e106-4712-9a22-56bf102ddf30', 'Blue Cheese Dressing ', 238, 20, 521, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'When I was a single gal in NYC and my parents lived in Westchester we used to meet almost halfway for dinner at Guss in Harrison new york It is a great bar serving delicious seafood and their salad was my favoritered wine vinaigrette with big hunks of blue cheese We were always a blue cheeseloving family and my version with a creamy base cant compete with Gus is fantastic on a wedge of iceberg lettuce or as a dip It lasts for a good week in the fridge as well', '2023-06-12 17:23:41.271', '2023-06-13 00:23:35.274');
