INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('dbf72240-7e75-4656-a334-c120a6a3ea3d', 'Burmese Gin Thoke Melon Salad ', 821, 55, 993, 0, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'If its melon season you have to make this In Burma Myanmar gin thoke meaning ginger mix is a blend of crispy fried garlic sesame seeds and ginger and is eaten as a sweet digestive snack after meals Although not native to the region melons are a refreshing and delicious complement to this dressing together making a perfect summertime side dish The ginger is key to this salad Ideally the gingerroot should be so young that the skin is almost transparent and the roots are tipped with pink', '2023-06-12 17:23:41.295', '2023-06-13 00:23:35.274');
