INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('599e2441-c90d-4139-adc1-65430f21d8c4', 'Oranges in Red Wine ', 97, 0, 3, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'The kitchen was the domain of Miraglia Eriquezs grandmother but this recipe was her grandfathers specialty Sitting at the dining table Poppy as he was known would peel and cut oranges toss the pieces into glasses and cover them with red wine After the oranges soaked up and sweetened the wine he would eat forkfuls of the fruit then down the drink It wasand isthe perfect prelude to dessert', '2023-06-12 17:23:41.339', '2023-06-13 00:23:35.274');
