INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('a73c6a3a-30b8-4851-bdfa-c587f166e48f', 'Soba With Green Chile Pesto ', 142, 2, 571, 1, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'The key to cooking with chiles is to think of their heat not as a dare but as another essential building block of flavor right alongside salt acid and fat Rather than overpowering a dish a perfectly calibrated prickle of spice enhances the other elements and wakes up the palate', '2023-06-12 17:23:41.421', '2023-06-13 00:23:35.275');
