INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('0823133a-cca5-4e43-9bcc-347e47347934', 'Saffron Rice Pilaf ', 468, 17, 12, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'The color yellow symbolized joy for medieval Arabs who were cultivating saffron in Spain by 960 ce Sephardic Jews were equally inspired by the coveted spice and golden rice became a holiday and Sabbath tradition This version made with basmati rice is punctuated by caramelized onion currants and fried almonds', '2023-06-12 17:23:41.44', '2023-06-13 00:23:35.275');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('ff6c6162-301c-4b43-bb51-56a6293cb48a', 'Tomato Sauce ', 240, 22, 779, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Escoffier codified the mother sauces of French cooking In the ItalianAmerican tradition there is only one tomato sauce Call it marinara we do call it gravy we dont call it whatever your grandma called it Its tomato sauce Theres almost nothing we wont cook in it or put it on', '2023-06-12 17:23:41.446', '2023-06-13 00:23:35.275');
