INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('2aaea5b8-6496-4cdf-9915-c94a73a5446d', 'Soy-Pickled Jalapeños ', 54, 0, 3506, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Green chiles pickled in soy sauce and vinegar are a traditional Korean banchan so food editor Lillian Chou who created this menu was surprised when she discovered a similar dish made with jalapeos and soy sauce at a taco bar in Mexico But its no wonder the combination has universal appeal Here Chou calls for brown sugar and lemon zest in place of vinegar and the ingredients hit all the right spots hot salty and a little sweet Chile fanatics will be happy to munch on these just as they are but the jalapeos and their liquid also make a terrific accompaniment to the first course of epirecieplink id3510910shrimp and scallion pancakesepirecieplink', '2023-06-12 17:23:41.488', '2023-06-13 00:23:35.275');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('ccc41c0b-6304-459b-add0-49556d5ff8d6', 'Skillet-Toasted Quinoa ', 156, 3, 2, 1, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Skillettoasting quinoa will add ure and flavor to a dish I recommend using a nonstick skillet for this If you use a standard skillet the quinoa requires more attention and the skillet needs occasional scraping The goal is for the quinoa to retain its tenderness but acquire a toasted exterior You can cook the quinoa more or less according to your taste preferences', '2023-06-12 17:23:41.493', '2023-06-13 00:23:35.275');
