INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('77c7a931-577a-47f4-89f6-523fe1160b7b', 'Peach Prosecco ', 254, 1, 5, 0, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Sean Traynor bartender at The Windsor in Phoenix Arizona created this crisp beautifully hued cocktail for our story Spring Cocktails Perfect for Brunch Sparkling wine is often used to top off a drink but in this case Traynor mixes it with the rest of the ingredients in the cocktail shaker The reason Hes using it more for its acidity and flavor than effervescence For pure peach flavor Traynor insists on a true peachbased liqueur so put away the peach Schnapps he recommends Sathenay Crme de Pche de Vigne Liqueur Rothman  Winter Orchard Peach Liqueur or Massenez Crme de Pche', '2023-06-12 17:23:41.599', '2023-06-13 00:23:35.275');
