INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('1b0ae853-5dbf-4fa1-975c-80bff25dfe90', 'Tomatillo-Avocado Salsa with Tortilla Chips ', 0, 0, 0, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'The tangy tomatillos are balanced by rich buttery avocados Serve with your favorite tortilla chipsand Margaritas', '2023-06-12 17:23:41.612', '2023-06-13 00:23:35.275');
INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('6acef10c-06eb-409c-ae0e-effeaa0a578f', 'Cabernet-Cranberry Sauce with Figs ', 265, 0, 3, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Who knew Cabernet and cranberries would make such a dynamic duo Add dried figs plumped in the Cabernet ahead of time and you end up with a winey fruity fig bar minus the cookie This sauce is so fine youll be spooning leftovers on ice cream or slathering it on toast in place of jam Its worth buying extra cranberries and freezing them so you can make more to last you through the winter', '2023-06-12 17:23:41.616', '2023-06-13 00:23:35.275');
