INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('9cfc92cf-0071-4cb3-9478-1db157c0eb2a', 'Brussel Leaf and Baby Spinach Sauté ', 232, 16, 83, 4, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'If you are the cook around the house you know how sweet the words I love this Please make it again sound This side has become my goto dish for something quick and pretty as I love the juxtaposition of the two shades of green After you remove the leaves from the brussels sprouts this takes only minutes to prepare Brussels sprouts are miniature balls of cabbage so their stems can be pretty tough By working from the outermost leaf inward and cutting more of the stem whenever necessary you follow the pattern of the sprout to easily remove its leaves You can do this part in advance but youll want to saut them just before serving', '2023-06-12 17:23:41.634', '2023-06-13 00:23:35.275');
