INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('cada0329-d288-4922-b2b4-b34ab364798a', 'Sweet Summer Corn Soup ', 0, 0, 0, 5, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'Perfecting this recipe required a motherdaughter collaboration My mom started it off by cutting the kernels off the cobs simmering the corncobs in the stock and then scraping the cobs to capture every ounce of delicious corn flavor Her friend Darryle Pollack taught her the trick of including potatoes and blending part of the soup to thicken it I added warming spices like paprika and cayenne pepper to complement the sweetness of the summer corn and topped it with charred red bell peppers Together we created a perfect soup Marea', '2023-06-12 17:23:42.007', '2023-06-13 00:23:35.276');
