INSERT INTO "Recipe" ("id", "title", "calories", "fat", "sodium", "rating", "image", "description", "createdAt", "updatedAt") VALUES ('e302228f-9a8b-4c1a-abdb-41843c9871b1', 'Roasted and Raw Carrot Salad with Avocado and Toasted Cumin Vinaigrette ', 293, 27, 647, 3, 'https://raw.githubusercontent.com/capstone-first/vegalicious-images/main/56390114_vegan-chocolate-tart.jpg', 'I love using baby carrots in assorted colors Thumbelina carrots which are little and stubby are great for roasting I use red orange yellow and white carrots for the ribbons which make this salad so vibrant Even just the orange variety next to the green of the avocado and mizuna makes a beautiful and colorful salad Toasting whole cumin seeds and then grinding them in a mortar and pestle or an electric spice grinder is essential for the great taste of this vinaigrette If you dont have either way of grinding spices you can substitute cumin powder This salad rocks from the contrast between the soft ure and caramelized sweetness of the roasted carrots and their raw and crunchy counterparts', '2023-06-12 17:23:42.135', '2023-06-13 00:23:35.276');
